// import Link from "next/link";
import css from "./Navbar.css";
import NavLink from "../NavLink/NavLink.js"

const Navbar = props => (
  <div className={`${css.navbar} ${css.regNav}`}>
    <NavLink name="About Us" url="page/about/"/>
    <NavLink name="Portfolio" url="case-studies/"/>
    <NavLink name="What We Do" url="#what-we-do"/>
    <NavLink name="Who We Serve" url="#who-we-serve"/>
    <NavLink name="Contact Us" url="page/contact/"/>
    <img className={css.hamburgerMenu} src="https://labs.chiedo.com/wp-content/themes/chiedolabs/img/mob-trig.png" alt="Mobile menu hamburger icon" title="Mobile menu icon"/>
  </div>
);

export default Navbar;
